open(unit=3,file="levels")
read(2,*)
read(2,*) n_states
do p=1,n_states 
read(2,*) test(min_mode:max_mode)
total=0
do i=min_mode,max_mode
  total=total+w(i)*test(i)
  total=total+c(i,0,0)*(test(i))
  total=total+c(i,i,0)*(test(i)+0.5)**2-c(i,i,0)*(0.5)**2
  total=total+c(i,i,i)*(test(i)+0.5)**3-c(i,i,i)*(0.5)**3
do j=i+1,max_mode
  total=total+c(i,j,0)*(test(i)+0.5)*(test(j)+0.5)-c(i,j,0)*(0.5)*(0.5)
  total=total+c(i,i,j)*(test(i)+0.5)**2*(test(j)+0.5)-c(i,i,j)*(0.5)**3
  total=total+c(j,j,i)*(test(i)+0.5)*(test(j)+0.5)**2-c(j,j,i)*(0.5)**3
do k=j+1,max_mode
  total=total+c(i,j,k)*(test(i)+0.5)*(test(j)+0.5)*(test(k)+0.5)-c(i,j,k)*(0.5)**3
enddo
enddo
enddo
write(3,*) test(min_mode:max_mode),total
