function delta(i,j,k) result(a)
double precision, intent(in) :: i,j,k 
double precision             :: a 
a = (i+j+k)*(i-j-k)*(j-i-k)*(k-i-j)
end function


subroutine sort(a)
implicit none
integer,dimension(6) :: a
integer :: i,j,t

do i=1,6
do j=1,6
  if (a(i).lt.a(j)) then
    t=a(j)
    a(j)=a(i)
    a(i)=t
  endif
enddo
enddo

